h1,
h2,
h3,
h4 {
  color: #71bf44;
}

div {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  padding: 5px;
  font-size: 1rem;
}

nav {
  /* Shouldn't have a background until scrolled down at all */
  width: 100vw;
  display: flex;
  justify-content: center;
  align-items: center;
}

nav ul {
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  align-items: center;
  width: 100%;
  margin-left: -40px;
  font-size: 1rem;
  font-weight: 500;
}

li {
  list-style-type: none;
}

li a {
  text-decoration: none;
  color: black;
}

li img {
  height: 2rem;
}

/* ---- particles.js container ---- */
#particles-js {
  background-color: #000000;
  position: absolute;
  height: 75vh;
  width: 100vw;
}

#header {
  color: #fefefe;
  font-size: 1.4rem;
  position: relative;
  height: 75vh;
}

#header h2 {
  font-size: 2rem;
  text-align: left;
  font-weight: 100;
  color: #fefefe;
}

#about {
  margin-top: 1rem;
}

.intro {
  width: 85%;
  padding: 25px 0;
}

.serviceCards {
  display: flex;
  flex-direction: column;
}

.card {
  display: flex;
  flex-direction: column;
  justify-content: center;
  padding: 25px 15px;
  margin-bottom: 3rem;
  border-radius: 5px;
  max-height: 40%;
  max-width: 80%;
  font-size: 1rem;
  padding-top: 10rem;
}

h2 {
  text-align: center;
  font-size: 1.5rem;
  margin: 5rem 0;
}

.card p {
  align-self: center;
  font-size: 1.2rem;
  text-align: center;
}

.cardHeader {
  display: flex;
  flex-direction: column;
  align-self: center;
}

.cardHeader img {
}

.card h3 {
  text-decoration: underline;
  color: #2d3436;
  text-decoration-color: #71bf44;
  padding: 15px;
}

#services {
}

.howItWorks {
  font-size: 2rem;
}

.step {
  display: flex;
  flex-direction: column;
  width: 100%;
  margin: 5rem 0 50rem 0;
  height: 15rem;
  width: 100vw;
  background: none;
  z-index: 2;
  color: white;
  margin-bottom: 1rem;
  line-height: 1.5rem;
}

.step p {
  width: 80%;
}

.step img {
  height: 19rem;
  max-width: 90vw;
}

.stepText {
  color: black;
  font-size: 1.2rem;
  width: 75vw;
  position: relative;
  background-color: white;
  padding: 1rem;
  border-radius: 5px;
  border: 2px solid hsla(0, 0%, 89%, 0.561);
  box-shadow: 0px 4px 6px -1px rgba(0, 0, 0, 0.1), 0px 2px 4px -1px rgba(0, 0, 0, 0.06);
  margin: -5rem 0 0 0;
}

.stepOne {
}

.stepTwo {
}

.stepThree .stepText {
  padding: 2rem 1rem;
}

.stepOne .stepText {
}

.leftText {
}

.rightText {
}

.leftPic {
  align-self: flex-end;
  border-top-right-radius: 2px;
  border-bottom-right-radius: 2px;
}

.rightPic {
  align-self: flex-start;
  border-top-left-radius: 2px;
  border-bottom-left-radius: 2px;
}

.formBtns {
  display: flex;
  flex-direction: row;
  width: 100%;
}

.formBtn {
  background: none;
  color: #71bf44;
  border: none;
}

.formBtn:hover {
  cursor: pointer;
}

#contact {
  height: 50vh;
  margin: 10vh 0;
}

form {
  height: 100%;
  width: 75vw;
  display: flex;
  flex-direction: column;
  align-items: center;
}

textarea,
input {
  padding: 10px;
  width: 100%;
  margin-bottom: 30px;
  font-size: 1rem;
  border: 2px solid hsla(0, 0%, 81%, 0.8);
  border-radius: 5px;
}

textarea {
  min-height: 7rem;
  width: 100%;
}

canvas {
  display: block;
}

footer {
  font-size: 0.8rem;
  width: 100vw;
  height: 90vh;
  color: black;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

footer img {
}

.showMe {
  padding: 25px 15px;
  border: 2px solid hsla(0, 0%, 89%, 0.561);
  box-shadow: 0px 4px 6px -1px rgba(0, 0, 0, 0.1), 0px 2px 4px -1px rgba(0, 0, 0, 0.06);
}

@media (min-width: 600px) {
  nav {
    padding: 15px;
    height: 5rem;
  }

  nav ul {
    font-size: 1.6rem;
    font-weight: 550;
    /* TODO: add underline on hover  */
  }

  li img {
    height: 5rem;
  }

  #header {
    font-size: 2rem;
  }

  #header h2 {
    font-size: 2.5rem;
  }

  #header p {
    font-weight: lighter;
  }

  .pros {
    font-size: 2.5rem;
  }

  .serviceCards {
    width: 100%;
    flex-direction: row;
    justify-content: space-evenly;
    margin-bottom: 10rem;
  }

  .card {
    height: 400px;
    width: 400px;
    padding: 25px 15px;
    border: 2px solid hsla(0, 0%, 89%, 0.561);
    box-shadow: 0px 4px 6px -1px rgba(0, 0, 0, 0.1), 0px 2px 4px -1px rgba(0, 0, 0, 0.06);
    font-size: 1.7rem;
  }

  .card img {
    height: 100px;
    padding: 15px;
  }

  .card h3 {
    font-size: 1.7rem;
    padding-bottom: 15px;
  }

  .step {
    margin: 10rem 0;
    height: 30rem;
  }

  .stepText {
    font-size: 2rem;
    padding: 3rem;
    text-align: center;
  }
  .howItWorks {
    font-size: 3rem;
  }
  .step img {
    height: 800px;
  }

  form input {
    font-size: 2rem;
  }
}

